import React, { Component } from 'react';
import {Environment} from '../components/environment/index';
import axios from 'axios';
import { If, Then, Else, Switch, Case} from 'react-if';

class Header extends Component {

    constructor (props){
        super(props);

        // this.state = {
        //     bannerList: []
        // }

        // axios.get(Environment.apiurl+'getBannerList')
        //     .then(result => {
        //         if(result){
        //             // console.log(result);
        //             this.setState({bannerList: result.data.response});
        //         }
        //     });

        const access_user_id = localStorage.getItem("user_id")?localStorage.getItem("user_id"):"";
    }

    logout(){
        localStorage.clear();
        window.location.href = '/';
    }

    render() {
        var guest = [];
        for (var i = 1; i <= 10; i++) {
            guest.push(i);
        }

        return (
            <div>
                <header>
                    <div class="topBar">
                        <div class="container">
                            <div class="row">
                                <aside class="col-sm-6 col-7">
                                    <ul class="socials">
                                        <li><a href="#"><i class="fab fa-facebook-f"></i></a></li>
                                        <li><a href="#"><i class="fab fa-twitter"></i></a></li>
                                        <li><a href="#"><i class="fab fa-google-plus-g"></i></a></li>
                                        <li><a href="#"><i class="fab fa-pinterest-p"></i></a></li>
                                        <li><a href="#"><i class="fab fa-instagram"></i></a></li>
                                    </ul>
                                </aside>
                                <If condition={localStorage.getItem("email")}>
                                    <Then>
                                        <aside class="col-sm-6 col-5"> 
                                            <a href="#" onClick={(e) => this.logout()}  data-toggle="modal" class="loginSite"><i class="fas fa-lock"></i>Logout</a> &nbsp;&nbsp;&nbsp;
                                            <a href="#" data-toggle="modal" class="loginSite"><i class="fas fa-user"></i>My-Account</a> 
                                        </aside>
                                    </Then>
                                    <Else>
                                        <aside class="col-sm-6 col-5"> 
                                            <a href="#" data-toggle="modal" data-target="#loginModal" class="loginSite"><i class="fas fa-lock"></i> Login / Register</a> 
                                        </aside>
                                    </Else>
                                </If>

                            </div>
                        </div>
                    </div>                
                    <div class="logoBar">
                        <div class="container">
                            <div class="row">
                                <div class="col-sm-3"> 
                                    <a href="index.html" class="siteLogo"><img src={Environment.apiurl+"/images/logo.png"} class="img-fluid" alt="" /></a>
                                </div>
                                <div class="col-sm-9"> 
                                    <a class="open-mypage1"><img src={Environment.apiurl+"/images/search-icon.png"} /></a>
                                    <div class="myCart"> 
                                        <a href="#"> <img src={Environment.apiurl+"/images/cart.png"} />
                                            <div class="cartValue">My Cart <span>$0.00</span></div>
                                        </a> 
                                    </div>
                                    <div id="mypage-info1">
                                        <div class="searchBar">
                                            <form action="" method="post">
                                                <input name="" type="text" placeholder="Keywords here..." />
                                                <button type="submit"><img src={Environment.apiurl+"/images/search-icon.png"} alt="" /></button>
                                            </form>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    <nav>
                        <div class="container">
                            <div class="siteMenus">
                                <ul>
                                <li><a href="product" class="active">Chemical Guys</a></li>
                                <li><a href="">Smartwax</a></li>
                                <li><a href="">Accessories</a></li>
                                <li><a href="">Detailing Tools</a></li>
                                <li><a href="">Microfiber Towels</a></li>
                                <li><a href="">Motorcycle Line</a></li>
                                <li><a href="">Detailing Kits</a></li>
                                <li><a href="">Shirts &amp; Gear</a></li>
                                <li><a href="">Contact Us</a></li>
                                </ul>
                            </div>
                        </div>
                    </nav>
                </header>
            </div>
        )
    }
}

export default Header;
